import React from "react";

function NavBar() {
  return (
    <nav>
      <div>
        <h1>Cutecat Shop</h1>
        <p>CuteCat Store</p>
      </div>
      <ul>
        <li>GiftBox</li>
        <li>Bazar</li>
        <li>Vajilla Cat</li>
      </ul>
    </nav>
  );
}

export default NavBar;
